Descrição:
- Indicada para a limpeza de folhas;
- Possui cabo de 120cm em madeira renovável;
- Vassoura leve e manuseio super confortável;

Fácil Instalação;
Tampa suporta até 200 kg;
Durabilidade, pois o material não se degrada ou oxida em contato com água/esgoto;
Fácil acabamento com o piso: formato quadrado;
Não utiliza parafusos na fixação, sistema click.

O Kit de Pintura e Acabamento Atlas 5 Peças é ideal para pintura em superfícies lisas e semi rugosas. Deve ser usado com tintas acrílicas, látex (PVA) e esmaltes.

O kit contém:
- 1x Bandeja 2,7 litros;
- 1x Trincha de 1” de Cerdas Gris;
- 1x Rolo de Espuma 9 cm;
- 1x Garfo com Buchas sem Rosca 23 cm;
- 1x Rolo em Lã de Poliéster de Alta Densidade 23 cm (altura da lã de 16 mm).
